// ==UserScript==
// @name         禁漫娘图片加载动画
// @namespace    https://sfkgroup.github.io/
// @version      0.4
// @description  本脚本将网页中所有图片的加载动画(background)替换成为了禁漫娘转手指.
// @author       SFKgroup
// @match        *://*/*
// @grant        GM_log
// @icon         https://sfkgroup.github.io/images/favicon.ico
// @license      LGPL
// @downloadURL https://update.greasyfork.org/scripts/468062/%E7%A6%81%E6%BC%AB%E5%A8%98%E5%9B%BE%E7%89%87%E5%8A%A0%E8%BD%BD%E5%8A%A8%E7%94%BB.user.js
// @updateURL https://update.greasyfork.org/scripts/468062/%E7%A6%81%E6%BC%AB%E5%A8%98%E5%9B%BE%E7%89%87%E5%8A%A0%E8%BD%BD%E5%8A%A8%E7%94%BB.meta.js
// ==/UserScript==

(function () {
    var loading = 'url(data:image/gif;base64,)'

    var images = []
    var origin = []
    var loaded = []
    var count = 0
    var len = 0

    var im = document.getElementsByTagName('img')

    for (let k = 0; k < im.length; k++) {
        images[k] = im[k]
        origin[k] = images[k].style.backgroundImage
        images[k].style.backgroundImage = loading
        loaded[k] = false
    }

    function main() {
        for (let i = 0; i < im.length; i++) {
            len = images.length
            if (images.indexOf(im[i]) == -1) {
                images[len] = im[i]
                origin[len] = images[len].style.backgroundImage
                images[len].style.backgroundImage = loading
                loaded[len] = false
            }
        }

        for (let i = 0; i < images.length; i++) {
            if (images[i].complete && !loaded[i]) {
                images[i].style.backgroundImage = origin[i]
                loaded[i] = true
            }
        }
        if (count == 3) {
            GM_log('Low_rate.')
            clearInterval(timer)
            timer = setInterval(main, 500)
        }
        count++

        //GM_log(images,loaded,origin)

    }

    var timer = setInterval(main, 50)

})();